import React, { useState } from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Login from "./pages/Signin/login";
import Cadastro from "./pages/Signup/cadastro";
import TelaInicial from "./pages/Home/main";
import PacienteInfo from "./pages/Pacientes/pacienteInfo";

const App: React.FC = () => {
   const [token, setToken] = useState("");
   const handleLogin = (newToken: string) => {
    setToken(newToken);
  };
   const scrollToTop = () => {
     window.scrollTo({
       top: 0,
       behavior: "smooth",
     });
   };



  return (
    <Router>
      <Routes>
        <Route path="/login" element={<Login onLogin={handleLogin} />} />
        <Route path="/cadastro" element={<Cadastro />} />
        <Route path="/tela-inicial" element={<TelaInicial />} />
        <Route path="/" element={<Login onLogin={handleLogin} />} /> {}
        <Route path="/paciente" element={<PacienteInfo token={token} />} />
      </Routes>
    </Router>
  );
};

export default App;
